import { Button,makeStyles, Table, TableBody, TableCell, TableHead, TableRow } from "@material-ui/core";
import { categories } from "../constants/data";
const useStyle=makeStyles({
    create:{
        margin:20,
        background:'#6495ED',
        color:'#fff',
        width:'86%'
    },
    table:{
        border:'1px solid rgba(224,224,224,1)'
    }
})


const Categroies=()=>{
    const classes=useStyle();
    return(
        <>
            <Link to='/create'> <Button variant="contained" className={classes.create}>+ Create Blog</Button> </Link>
            <Table className={classes.table}>
                <TableHead>
                    <TableRow>
                        <TableCell>ALL CATEGORIES</TableCell>
                    </TableRow>                    
                </TableHead>
                <TableBody>
                    {
                        categories.map(category =>(
                            <TableRow>
                                <TableCell>{category}</TableCell>
                            </TableRow>
                        ))
                    }
                </TableBody>
            </Table>
        </>

    ) 
}

export default Categroies;
